const assert = require("assert");

import login_po from "../page-objects/login_po";
import folder_po from "../page-objects/folder_po";

describe("Test ProtonMail folder settings", () => {
  it("should Log In", () => {
    login_po.open();
    login_po.succesfulLogin();
  });

  //modal for new user

  it("should close modal", () => {
    const closeModalbtn = $("button=Next");
    closeModalbtn.click();

    const closeModalbtn1 = $("button=Next");
    closeModalbtn1.click();

    const closeModalbtn2 = $("button=Next");
    closeModalbtn2.click();

    const closeModalbtn4 = $("button=Start exploring");
    closeModalbtn4.click();
  });

  it("should open folder/labels settings", () => {
    const folderAndLabels = $("#labelSettings");
    folderAndLabels.click();
  });

  it("should create folder", () => {
    folder_po.newFolder();
    folder_po.successfulNotification.waitForDisplayed(3000);
    expect(folder_po.successfulNotificationText).to.have.string("created");
    browser.pause(4000);
  });

  it("should edit folder", () => {
    folder_po.updateFolder();
    folder_po.successfulNotification.waitForDisplayed(3000);
    expect(folder_po.successfulNotificationText).to.have.string("updated");
    browser.pause(4000);
  });

  it("should delete folder", () => {
    folder_po.deleteFolder();
    folder_po.successfulNotification.waitForDisplayed(3000);
    expect(folder_po.successfulNotificationText).to.have.string("removed");
    browser.pause(2000);
  });
});

