const assert = require("assert");

import login_po from "../page-objects/login_po";
import label_po from "../page-objects/label_po";

describe("Test ProtonMail label settings", () => {
  it("should Log In", () => {
    login_po.open();
    login_po.succesfulLogin();
  });

  //modal for new user

  it("should close modal", () => {
    const closeModalbtn = $("button=Next");
    closeModalbtn.click();

    const closeModalbtn1 = $("button=Next");
    closeModalbtn1.click();

    const closeModalbtn2 = $("button=Next");
    closeModalbtn2.click();

    const closeModalbtn4 = $("button=Start exploring");
    closeModalbtn4.click();
  });

  it("should open folder/labels settings", () => {
    const folderAndLabels = $("#labelSettings");
    folderAndLabels.click();
  });

  it("should create label", () => {
    label_po.newLabel();
    label_po.successfulNotification.waitForDisplayed(3000);
    expect(label_po.successfulNotificationText).to.have.string("created");
    browser.pause(4000);
  });

  it("should edit label", () => {
    label_po.updateLabel();
    label_po.successfulNotification.waitForDisplayed(3000);
    expect(label_po.successfulNotificationText).to.have.string("updated");
    browser.pause(4000);
  });

  it("should delete label", () => {
    label_po.deleteLabel();
    label_po.successfulNotification.waitForDisplayed(3000);
    expect(label_po.successfulNotificationText).to.have.string("removed");
    browser.pause(3000);
  });
});

