import base_po from "./base_po";
var config = require("../config/variables");
var dataGenerator = require("../config/dataGenerator");

class label_po extends base_po {
  open() {
    super.open("https://beta.protonmail.com/settings/labels");
  }

  get addLabel() {
    return $(".pm-button*=label");
  }

  get labelName() {
    return $("#accountName");
  }

  get SubmitNewLabel() {
    return $(".pm-button*=Submit");
  }

  get successfulNotification() {
    return $(".notification-success");
  }

  get successfulNotificationText() {
    return this.successfulNotification.getText(); //created
  }

  get deleteButton() {
    return $("button.pm-button--for-icon");
  }

  get delFolder() {
    return $("button*=Delete");
  }

  get deleteConfirm() {
    return $(".pm-button*=Confirm");
  }

  get editLabel() {
    return $("button*=Edit");
  }

  newLabel() {
    this.addLabel.click();
    this.labelName.setValue(dataGenerator.randomName());
    this.SubmitNewLabel.click();
  }

  updateLabel() {
    this.editLabel.click();
    this.labelName.setValue(config.editName);
    //this.colors.click();
    this.SubmitNewLabel.click();
  }

  deleteLabel() {
    this.deleteButton.click();
    this.delFolder.click();
    this.deleteConfirm.click();
  }
}

export default new label_po();

