const assert = require("assert");

var config = require("../config/variables");
import login_po from "../page-objects/login_po";
import folder_po from "../page-objects/folder_po";
import label_po from "../page-objects/label_po";
import dragAndDrop_po from "../page-objects/dragAndDrop_po";

describe("Test ProtonMail folders/labels ordering", () => {
  // it("should open homepage", () => {

  // });

  it("should Log In", () => {
    dragAndDrop_po.open();
    login_po.succesfulLogin();
  });

  //modal for new user

  it("should close modal", () => {
    const closeModalbtn = $("button=Next");
    closeModalbtn.click();

    const closeModalbtn1 = $("button=Next");
    closeModalbtn1.click();

    const closeModalbtn2 = $("button=Next");
    closeModalbtn2.click();

    const closeModalbtn4 = $("button=Start exploring");
    closeModalbtn4.click();
  });

  it("should open folder/labels settings", () => {
    const folderAndLabels = $("#labelSettings");
    folderAndLabels.click();
  });

  it("should create new folder", () => {
    folder_po.newFolder();
    folder_po.successfulNotification.waitForDisplayed(3000);
    expect(folder_po.successfulNotificationText).to.have.string("created");
    browser.pause(4000);
  });
  it("should create another new folder", () => {
    folder_po.newFolder();
    folder_po.successfulNotification.waitForDisplayed(3000);
    expect(folder_po.successfulNotificationText).to.have.string("created");
    browser.pause(4000);
  });

  it("should create new label", () => {
    label_po.newLabel();
    label_po.successfulNotification.waitForDisplayed(3000);
    expect(label_po.successfulNotificationText).to.have.string("created");
    browser.pause(2000);
  });

  it("should change order of labels/folders in the list", () => {
    dragAndDrop_po.dragAndDropRows();
  });
});

